/* Abroad_product_info */
create or replace FUNCTION GET_ABROAD_PROD_FN RETURN SYS_REFCURSOR AS
/* scope of order distribution (Abroad Product) */
P_VALUE SYS_REFCURSOR;
BEGIN
    OPEN P_VALUE FOR select product_desc,moh_price,moh_cost,item_code from v30001 where abroad_flag='1' ORDER BY TRIM(product_desc);
    RETURN P_VALUE;
END;
